description.text:
Hey, everybody! So, this is officially the biggest piece I've ever printed (pushed the limits of my plate in all directions). Its a backer reward for Ill Gotten Games' first Kickstarter campaign, the tabletop RPG, &quot;Wayfarer.&quot;  
This is a project that my friends and I have been working on for over 10 years now, and if you're interested in tabletop roleplaying games and would like to support us, I urge you to check it out here:  <a rel="nofollow" href="https://www.kickstarter.com/projects/292543184/wayfarer-slipstream-rpg-adventures-through-the-mul" >https://www.kickstarter.com/projects/292543184/wayfarer-slipstream-rpg-adventures-through-the-mul</a>  
In Wayfarer, Omnispheres are structures left behind by a long-gone alien species that, if operated by a highly specialized technician known as a &quot;Doorman,&quot; may transport a party of adventurers to another Omnisphere located in a different reality. This is a massive terrain piece scaled for 28mm gaming (the top is even removable so you can put models inside).
